// app.js

import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

// Home Page Component
function Home() {
  return (
    <div className="section">
      <header>
        <nav>
          <Link to="/" className="logo">VOXXY</Link>
          <Link to="/">Home</Link>
          <Link to="/trip-planner">Trip Planner</Link>
          <Link to="/about-us">About Us</Link>
          <Link to="/login">Log In</Link>
          <Link to="/logout">Log Out</Link>
        </nav>
      </header>
      <main>
        <h1>Plan Your Next Adventure, with Voxxy!</h1>
        <p>Smart, seamless, and stress-free trip planning designed just for you and your crew.</p>
        <div>
          <button className="button button-primary">Sign up to get started</button>
          <button className="button button-secondary">Log in to continue</button>
        </div>
      </main>
    </div>
  );
}

// Trip Planner Page Component
function TripPlanner() {
  return (
    <div className="section">
      <h1>Trip Planner</h1>
      <p>Plan your journey with precision and ease.</p>
    </div>
  );
}

// About Us Page Component
function AboutUs() {
  return (
    <div className="section">
      <h1>About Us</h1>
      <p>Learn more about the Voxxy team and our mission.</p>
    </div>
  );
}

// Login Page Component
function Login() {
  return (
    <div className="section">
      <h1>Login</h1>
      <p>Access your personalized dashboard here.</p>
    </div>
  );
}

// App Component with Routes
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/trip-planner" element={<TripPlanner />} />
        <Route path="/about-us" element={<AboutUs />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
